import './Product.css'
const Product = (props) => {
    console.log(props);
    const { img, name, category, price, ratings } = props.product;
    return (
        <div className='product'>
            <img src={img} alt="" />
            <p className='product-name'>{name}</p>
            <p className='product-price'>{price}</p>
        </div>
    );
};

export default Product;
